import React from 'react'
import {BrowserRouter as Router} from 'react-router-dom'
import {DataProvider} from './GlobalState'

function App() {
  return (
    <DataProvider>
    <div className="App">
      Hello World
    </div>
    </DataProvider>
  );
}

export default App;
